def list_python_files(directory):
    python_files = []
    for root, dirs, files in os.walk(directory):
        for file in files:
            if file.endswith('.py'):
                # Get the full path of the Python file
                full_path = os.path.join(root, file)
                python_files.append(full_path)
    return python_files

